const Arrays=()=> {
  const car=[
    {Image:<img src='https://www.shutterstock.com/image-vector/icon-logo-sign-art-sedan-260nw-2484157269.jpg' alt="carimage" width={300}/> , Name:"TOYOTA COROLLA ", Price:"PKR 10000000" , Reviews:"4.5 STARS" },
    {Image:<img src='data:image/jpeg;base64,' alt="carimage" width={290} /> , Name:"HONDA CIVIC ",    Price:"PKR 1200000" , Reviews:"4.5 STARS" },
    {Image:<img src='data:image/jpeg;base64,' alt="carimage" width={290} /> , Name:"TOYOTA ROYAL",   Price:"PKR 100000000" , Reviews:"4.8 STARS" },
    {Image:<img src='data:image/jpeg;base64,' alt="carimage" width={310} /> , Name:"MERCEDIES BENZ S CLASS", Price:"PKR 890000000" , Reviews:"5.0 STARS" },
  ]
  return(
    <div className='w-full h-screen bg-blue-200'>
      <h1 className='text-center text-5xl font-bold py-2'>CAR INFORMATION USING MAP</h1>
    <div className='flex justify-center gap-5'>
      {
        car.map((veh)=>{
          return(
            <div className='mt-3 border hover:border-black hover:shadow-lg hover:shadow-black h-full hover:font-semibold'>
             <p>{veh.Image}</p> 
             <div className='bg-black text-white py-2'>
             <h1 className='text-center ' >{veh.Name}</h1>
             <p  className='text-center ' >{veh.Price}</p>
             <p  className='text-center' >{veh.Reviews}</p> 
             </div>
            </div>
          )
        })
      }
    </div>
   
    </div>
  )
   
}

export default Arrays